import React from "react";
import "./ExpensesList.css";
import ExpenseItem from "./ExpenseItem";
const ExpensesList = (props) => {
  return (
    <div>
      if(props.items.length === 0) {}
      return{" "}
      <ul className="expenses-list">
        {props.items.map((exp) => (
          <ExpenseItem
            key={exp.id}
            title={exp.title}
            amount={exp.amount}
            date={exp.date}
          />
        ))}
      </ul>
    </div>
  );
};

export default ExpensesList;
